import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav style={styles.navbar}>
      <div style={styles.containerBox}> {/* Background container */}
        <ul style={styles.navList}>
          <li style={styles.navItem}>
            <Link to="/" style={styles.link}>Home</Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/about" style={styles.link}>About Us</Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/contact" style={styles.link}>Contact</Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/dashboard" style={styles.link}>COVID-Dashboard</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    background: "green",
    padding: "15px",
    display: "flex",
    justifyContent: "center",
  },
  containerBox: {
    backgroundColor: "rgba(255, 255, 255, 0.1)", // Semi-transparent background
    padding: "10px 20px",
    borderRadius: "10px",
    boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.2)",
    display: "inline-block",
  },
  navList: {
    display: "flex",
    listStyle: "none",
    margin: 0,
    padding: 0,
    flexWrap: "wrap", // Wrap items on smaller screens
  },
  navItem: {
    marginRight: "20px",
  },
  link: {
    color: "#fff",
    textDecoration: "none",
    fontSize: "20px",
  },

  // Media query for smaller screens
  '@media (max-width: 600px)': {
    navbar: {
      padding: "10px",
    },
    containerBox: {
      padding: "15px", // Adjust padding for smaller screens
      textAlign: "center",
    },
    navList: {
      flexDirection: "column", // Stack items vertically
      alignItems: "center",
    },
    navItem: {
      marginRight: 0,
      marginBottom: "10px", // Space between items in the column
    },
    link: {
      fontSize: "18px", // Adjust font size for smaller screens
    },
  },
};

export default Navbar;
